import React from 'react';

export const About = () => {
    return (
            <div className="jumbotron jumbotron-fluid">
                <div className="container">
                    <h1 className="display-4">Информация</h1>
                    <p className="lead">Версия приложения: <strong>.0</strong></p>
                </div>
            </div>
    )
}
